import React from "react";

export default (props) => {
    console.log(props.data);
    // let displayAlbum = !props.data.albumLevel ? "hide": null;
    return(
        <div>
        <div className={!this.data.albumLevel ? "hide": null} onClick={props.handleClick} id={props.data.id}>
            <h2>Album is on: {props.data.albumId}</h2>
            {/* <h2>ID: {props.data.photoDB.id}</h2>
            <h2>Title: {props.data.photoDB.title}</h2> */}
            <img src={props.data.thumbnailUrl} className="App-logo" alt="props.data.photoDB.title" />
            {/* <h2 style={{color:"#fff"}}>I'm very lazy ::::::></h2> */}
            <p>{props.data.url}</p>
        </div>

        
        </div>
    )
}

